// this file might be included twice during release, so...
if (!function_exists('md5_file_rtrim')) {
    define('FILE_INTEGRITY_MISSING', 1);
    define('FILE_INTEGRITY_MODIFIED', 2);

    function md5_file_rtrim($entry)
    {
        $fp = fopen($entry, 'r');
        $chars = '';
        while (($line = fgets($fp)) !== false) {
            $chars .= rtrim($line);
        }
        fclose($fp);

        return md5($chars);
    }

    function checkFiles()
    {
        $errors = array();
        $allOK = true;
        foreach ($GLOBALS['files'] as $file => $md5) {
            if (!file_exists($file)) {
                $errors[] = array($file, FILE_INTEGRITY_MISSING);
            } else {
                // the first md5 ($md5[0]) is of the unencoded file (used by the incremental upgrade generator)
                // and the second one ($md5[1]) of the encoded file 
                if (md5_file($file) != $md5[1]) {
                    $errors[] = array($file, FILE_INTEGRITY_MODIFIED);
                }
            }
        }

        return $errors;
    }
}

if (!isset($skipCheck)) {
    if ($errors = checkFiles()) {
        foreach ($errors as $arrError) {
            switch ($arrError[1]) {
                case FILE_INTEGRITY_MISSING:
                    echo "file {$arrError[0]} is missing<br />\n";
                    break;
                case FILE_INTEGRITY_MODIFIED:
                    echo "file {$arrError[0]} has been modified<br />\n";
                    break;
                default:
                    die('Error #83890: invalid error type');
                    break;
            }
        }
    } else {
        echo "All files are OK\n";
    }
}

